import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 28, height: 28, viewBox: "0 0 28 28", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M9.75 3a.75.75 0 00-.75.75V8H6.75A3.75 3.75 0 003 11.75v8.5A3.75 3.75 0 006.75 24h14.5A3.75 3.75 0 0025 20.25v-8.5A3.75 3.75 0 0021.25 8H19V3.75a.75.75 0 00-.75-.75h-8.5zm7.75 5h-7V4.5h7V8z", fill: primaryFill }));
};
const Briefcase28Filled = wrapIcon(rawSvg({}), 'Briefcase28Filled');
export default Briefcase28Filled;
